import React from 'react';
import "./WalletList.css";

const WalletList = (props) => {
    return (
        <div className="wallet">
            <div className="walletType-heading">Wallet Type</div>
            <div className="walletType-subheading">We currently only support Anchor wallet, but we will be adding more soon!</div>
            <div className="walletType-btn" onClick={props.ual.showModal}>Anchor</div>
            <div className="walletType-cmgSoon">Comming Soon...</div>
            <div className="flexContainer">
                <div className="walletType-btn walletType-disablebtn">Scatter</div>
                <div className="walletType-btn walletType-disablebtn">Ledger</div>
                <div className="walletType-btn walletType-disablebtn">Trezor</div>
            </div>
            <div className="flexContainer">
                <div className="walletType-btn walletType-disablebtn">SimplEOS</div>
                <div className="walletType-btn walletType-disablebtn">Lynx</div>
                <div className="walletType-btn walletType-disablebtn">EOS</div>
            </div>
        </div>
    )
}

export default WalletList;
